import { POST_USER_INFO } from '../Actions/actions';

const initialState = {
    user: {
        email : '',
        username: '',
        password: ''
    }
}

export function postUserInfo(state = initialState, action) {
    switch (action.type) {
        case POST_USER_INFO: 
            return {
                ...state,
                user: actions.res
            }

        default:
            return state
    }
}
